import React, { PureComponent } from 'react';
import { PieChart, Pie, Tooltip} from 'recharts';

const data01 = [
  { name: 'Group A', value: 400 },
  { name: 'Group B', value: 300 },
  { name: 'Group C', value: 300 },
  { name: 'Group D', value: 200 },
];
export default class ChartSection extends PureComponent {
  constructor(props) {
    super(props)
    this.state = {
        ChartSection: []
    };
}

componentDidMount() {
    axios.get('http://127.0.0.1:8000/api/chart_section')
    .then(res => {
        this.setState({
            users: res.data.data
        });
    })
    .catch((error) => {
    console.log(error);
    })
}

  render() {
    return (
            <PieChart width={300} height={300}>
            <Pie
                dataKey="value"
                isAnimationActive={false}
                data={data01}
                cx="50%"
                cy="50%"
                outerRadius={80}
                fill="#8884d8"
                label
            />
            <Tooltip />
            </PieChart>
    );
  }
}
